import React from "react";

const HistoryPage = () => {
  return (
    <div style={{ maxWidth: "1200px", margin: "0 auto", padding: "2rem" }}>
      <h1>교정 내역</h1>
      <div style={{ marginTop: "2rem" }}>
        <h2>구현 중인 기능입니다</h2>
        <p>곧 교정 내역을 볼 수 있습니다.</p>
      </div>
    </div>
  );
};

export default HistoryPage;
